6d8 elementor-widget elementor-widget-heading" data-id="41f856d8" data-element_type="widget" data-settings="{&quot;_animation_mobile&quot;:&quot;none&quot;}" data-widget_type="heading.default"><div class="elementor-widget-container"> <span class="elementor-heading-title elementor-size-xxl">Kapsul Sanjaya </span></div></div><div class="elementor-element elementor-element-5e4bfb4a elementor-widget elementor-widget-text-editor" data-id="5e4bfb4a" data-element_type="widget" data-settings="{&quot;_animation_mobile&quot;:&quot;none&quot;}" data-widget_type="text-editor.default"><div class="elementor-widget-container"><div class="elementor-text-editor elementor-clearfix"><p>Solusi Berbagai Penyakit Anda</p></div></div></div><div class="elementor-element elementor-element-1c735e55 elementor-widget elementor-widget-text-editor" data-id="1c735e55" data-element_type="widget" data-settings="{&quot;_animation_mobile&quot;:&quot;none&quot;}" data-widget_type="text-editor.default"><div class="elementor-widget-container"><div class="elementor-text-editor elementor-clearfix"><div class="draft-block draft-block-unstyled"><p style="text-align: center;">Tahukah Anda berbagai macam penyakit seperti <span style="color: #ffff00;">Asam Urat, Sakit Pinggang, Tulang Nyeri, Otot Kaku, Nyeri Sendi, Pegal Linu, Bahkan Stroke dll</span> dapat disembuhkan hanya dengan meminum <span style="color: #ffff00;">Kapsul Sanjaya</span> secara rutin? Dengan <span style="letter-spacing: 1.1px; color: #ffff00;">Kapsul Sanjaya</span>, Anda akan merasakan khasiat yang luar biasa dan sudah terbukti oleh <span style="color: #ffff00;">70,000++</span> pembeli kami dari seluruh indonesia</p></div></div></div></div></div></div></div></section><section class="elementor-section elementor-top-section elementor-element elementor-element-539b8af8 elementor-section-stretched elementor-section-height-min-height elementor-section-content-middle elementor-section-boxed elementor-section-height-default elementor-section-items